&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">Если подтвердится наличие ошибок в&amp;nbsp;системном коде, они&amp;nbsp;будут исправлены. Работы по&amp;nbsp;исправлению ошибок ведутся по&amp;nbsp;следующей схеме:&lt;br />
&lt;ul>&lt;li> Критические ошибки решаются в&amp;nbsp;течение &lt;span class="nobr">1&amp;ndash;2&lt;/span> дней.
&lt;/li>&lt;li> Некритические ошибки решаются в&amp;nbsp;течение 2 месяцев.
&lt;/li>&lt;li> Исправление ошибок начинается только после подтверждения их&amp;nbsp;наличия разработчиками системы.
&lt;/li>&lt;li> Статус критичности ошибок определяется разработчиками системы.&lt;/li>&lt;/ul>&lt;/div>&lt;/div>
</description>
